"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Dementia (including Alzheimer disease) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/dementia-including-alzheimer-disease-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H552500380\">",
"      <span class=\"h1\">",
"       What is dementia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Dementia is the general term for a group of brain disorders that cause memory problems and make it hard to think clearly (",
"      <a class=\"graphic graphic_figure graphicRef51927 \" href=\"mobipreview.htm?42/19/43312\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H552500387\">",
"      <span class=\"h1\">",
"       What symptoms does dementia cause?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms of dementia often start off very mild and get worse slowly. Symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Forgetting all sorts of things",
"       </li>",
"       <li>",
"        Confusion",
"       </li>",
"       <li>",
"        Trouble with language (for example, not being able to find the right words for things)",
"       </li>",
"       <li>",
"        Trouble concentrating and reasoning",
"       </li>",
"       <li>",
"        Problems with tasks such as paying bills or balancing a checkbook",
"       </li>",
"       <li>",
"        Getting lost in familiar places",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      As dementia gets worse, it can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Cause anger or aggression",
"       </li>",
"       <li>",
"        Make people see things that aren&rsquo;t there or believe things that aren&rsquo;t true",
"       </li>",
"       <li>",
"        Impair people&rsquo;s ability to eat, bathe, dress, or do other everyday tasks",
"       </li>",
"       <li>",
"        Cause people to lose bladder and bowel control",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H552500394\">",
"      <span class=\"h1\">",
"       What are the different kinds of dementia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most common kinds include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Alzheimer disease",
"        </strong>",
"        &ndash; Alzheimer disease is the most common cause of dementia. It causes brain cells to die.",
"       </li>",
"       <li>",
"        <strong>",
"         Vascular dementia",
"        </strong>",
"        &ndash; Vascular dementia happens when parts of the brain do not get enough blood. This can happen when blood vessels in the brain get clogged with blood clots or fatty deposits. This form of dementia is most common among people who have had strokes or who are at risk for strokes.",
"       </li>",
"       <li>",
"        <strong>",
"         Parkinson disease dementia",
"        </strong>",
"        &ndash; Parkinson disease is a brain disorder that affects movement. It causes trembling, stiffness, and slowness. As it gets worse, it can also cause dementia.",
"       </li>",
"       <li>",
"        <strong>",
"         Other causes of dementia",
"        </strong>",
"        &ndash; Dementia can also happen a person&rsquo;s brain has been damaged. For example, having many head injuries can lead to dementia.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H552500401\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, you should see a doctor or nurse if you think you or someone close to you is showing signs of dementia. Sometimes memory loss and confusion are caused by medical problems other than dementia that can be treated. For example, people with diabetes sometimes show signs of confusion when their blood sugar is not well controlled.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H552500408\">",
"      <span class=\"h1\">",
"       Are there tests I should have?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will decide which tests you should have based on your individual situation. Most people with signs of dementia do not need a brain scan. That&rsquo;s because the tests that are most useful are the ones that look at how you answer questions and do certain tasks. Even so, your doctor may want to do a brain scan (either CT or MRI) to make sure that your symptoms are not caused by a problem unrelated to dementia. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H552500415\">",
"      <span class=\"h1\">",
"       How is dementia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on what kind of dementia you have. If you have Alzheimer disease, there are medicines that might help some. If you have vascular dementia, your doctor will focus on keeping your blood pressure and cholesterol as close to normal as possible. Doing that can help reduce further damage to the brain.",
"     </p>",
"     <p>",
"      Sadly, there really aren&rsquo;t good treatments for most types of dementia. But doctors can sometimes treat troubling symptoms that come with dementia, such as depression or anxiety.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H552500422\">",
"      <span class=\"h1\">",
"       How do I stay safe?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you have dementia, you may not be aware of how much your condition affects you. Trust your family and friends to tell you when it is no longer safe for you to drive, cook, or do other things that could be dangerous.",
"     </p>",
"     <p>",
"      Be aware, too, that people with dementia often fall and hurt themselves. To reduce the risk of falls, it&rsquo;s a good idea to:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Secure loose rugs or use non-skid backing on rugs",
"       </li>",
"       <li>",
"        Tuck away loose wires or electrical cords",
"       </li>",
"       <li>",
"        Wear sturdy, comfortable shoes",
"       </li>",
"       <li>",
"        Keep walkways well lit",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H552500429\">",
"      <span class=\"h1\">",
"       Can dementia be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are no proven ways to prevent dementia. But here are some things that seem to help keep the brain healthy:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Physical activity",
"       </li>",
"       <li>",
"        Social interaction",
"       </li>",
"       <li>",
"        Keeping the brain busy, for example by reading or doing puzzles",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H552500436\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
