"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?14/33/14867?source=related_link\">",
"      Patient information: Hip fracture (The Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?24/19/24890?source=related_link\">",
"      Physical abuse in children: Diagnostic evaluation and management",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?22/42/23209?source=related_link\">",
"      Slipped capital femoral epiphysis (SCFE)",
"     </a>",
"    </li>",
