var title_f31_14_31979="Chompret diagn criteria Li-Fraumeni syndrome and TP53 testing";
var content_f31_14_31979=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F58516&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F58516&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Chompret diagnostic criteria for Li-Fraumeni syndrome and TP53 testing",
"    <sup>",
"     [1,2]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        One of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist_other_start\">",
"        &bull; A proband who has:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        - A tumor belonging to the LFS tumor spectrum (soft tissue sarcoma, osteosarcoma, pre-menopausal breast cancer, brain tumor, adrenocortical carcinoma, leukemia, or lung bronchoalveolar cancer) before age 46 years",
"        <strong>",
"         AND",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        - At least one first- or second-degree relative with an LFS tumor (except breast cancer if the proband has breast cancer) before age 56 years or with multiple tumors;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; A proband with multiple tumors (except multiple breast tumors), two of which belong to the LFS tumor spectrum and the first of which occurred before age 46 years;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; A proband who is diagnosed with adrenocortical carcinoma or choroid plexus tumor, irrespective of family history",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Tinat J, Bougeard G, Baert-Desurmont S, et al. 2009 Version of the Chompret criteria for Li Fraumeni syndrome. J Clin Oncol 2009; 27:e108.",
"       </li>",
"       <li>",
"        Li-Fraumeni Syndrome. Schneider K, Garber J. In: Pagon RA, Bird TC, Dolan CR, Stephens K, editors. GeneReviews [Internet]. Seattle (WA): University of Washington, Seattle; 1993-1999 Jan 19 [updated 2010 Feb 9].",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f31_14_31979=[""].join("\n");
