var title_f31_14_31980="Normal ausculatory findings of prosthetic valves";
var content_f31_14_31980=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F61951&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F61951&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Normal auscultatory findings of prosthetic valves according to type and location",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"        Valve prosthesis",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\" rowspan=\"1\">",
"        Auscultatory Findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Mitral",
"       </td>",
"       <td class=\"subtitle2\">",
"        Aortic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        Ball valves- eg, Starr-Edwards&nbsp;&nbsp;",
"       </td>",
"       <td colspan=\"1\">",
"        A2-MO interval 0.07-0.11 second",
"       </td>",
"       <td>",
"        S1-AO interval 0.07 second",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MO louder than MC",
"       </td>",
"       <td>",
"        AO louder than AC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soft systolic murmur",
"       </td>",
"       <td>",
"        Soft, harsh systolic ejection murmur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No diastolic murmur",
"       </td>",
"       <td>",
"        \"Seating puff\" - diastolic rumble",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        Disc valves- eg, Bjork-Shiley&nbsp;&nbsp;",
"       </td>",
"       <td colspan=\"1\">",
"        A2-MO interval 0.05-0.09 second",
"       </td>",
"       <td>",
"        S1-AO interval 0.04 second",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MO is soft or may not be audible",
"       </td>",
"       <td>",
"        AC louder than AO",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soft systolic murmur",
"       </td>",
"       <td>",
"        Soft systolic ejection murmur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soft and short diastolic rumble",
"       </td>",
"       <td>",
"        \"Seating puff\" - diastolic rumble",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"5\">",
"        Tissue valves- eg, Hancock&nbsp;&nbsp;&nbsp;",
"       </td>",
"       <td colspan=\"1\">",
"        A2-MO interval 0.1 second",
"       </td>",
"       <td>",
"        S1-AO interval 0.03-0.08 second",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MC louder than MO",
"       </td>",
"       <td>",
"        AC louder than AO",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MO is audible in approximately 50 percent",
"       </td>",
"       <td>",
"        AO may be absent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soft apical systolic murmur",
"       </td>",
"       <td>",
"        Soft systolic ejection murmur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soft diastolic ramble",
"       </td>",
"       <td>",
"        No diastolic rumble",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Bi-leaflet valves- eg, St. Jude",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Loud AO and AC&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Soft systolic ejection murmur",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     A2: aortic valve closure sound; MO: mitral prosthesis opening sound; MC: mitral prosthesis closing sound; S1: first heart sound; AO: aortic prosthesis opening sound; AC: aortic prosthesis closing sound.",
"    </div>",
"    <div class=\"reference\">",
"     Data from Smith ND, Ralzada V, Abrams J: Auscultation of the normally functioning prosthetic valve. Ann Intern Med 95:594, 1981.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
